import React from "react";
import "./Style/Home.css";
const Home = () => {
  return (
    <div className="library-container">
      <h1>Welcome to Our Books Library</h1>
      <div className="book-container">
        <div className="book">
          <img src="https://via.placeholder.com/150" alt="Book Cover" />
          <h2>Book Title 1</h2>
          <p>Author: Author Name 1</p>
        </div>
        <div className="book">
          <img src="https://via.placeholder.com/150" alt="Book Cover" />
          <h2>Book Title 2</h2>
          <p>Author: Author Name 2</p>
        </div>
        {/* Add more books here */}
      </div>
    </div>
  );
};

export default Home;
